import './App.css';

export const App = () => {
  return (
    <div className="App">
    <div className="app__header">
      <p className="app__header__title">Todo</p>
      <div className="app__header__filter-container">
        <a className="app__header__filter-container__button">All</a>
        <a className="app__header__filter-container__button">Active</a>
        <a className="app__header__filter-container__button">Done</a>
        <a className="app__header__filter-container__button">Important</a>
      </div>
    </div>
    <div className="todo-list"></div>
  </div>
  );
}
